-- Drop the schema if it already exists
DROP SCHEMA IF EXISTS drugData;

-- Create the schema
CREATE SCHEMA drugData;

-- Use the newly created schema
USE drugData;

-- Create the 'Drugs' table inside the schema


CREATE TABLE IF NOT EXISTS DrugInformation (
    drug_name VARCHAR(255),
    side_effect_1 VARCHAR(255),
    side_effect_2 VARCHAR(255),
    side_effect_3 VARCHAR(255),
    side_effect_4 VARCHAR(255),
    side_effect_5 VARCHAR(255),
    interacts_with VARCHAR(255),
    interacts_with_1 VARCHAR(255),
    interacts_with_2 VARCHAR(255),
    disease_name VARCHAR(255),
    disease_category VARCHAR(255),
    drug_category VARCHAR(255),
    product_name VARCHAR(255),
    company_name VARCHAR(255),
    clinical_trial_title VARCHAR(255),
    clinical_trial_start_date DATE,
    clinical_trial_completion_date DATE,
    clinical_trial_participants INT,
    clinical_trial_status VARCHAR(255),
    clinical_trial_condition VARCHAR(255),
    clinical_trial_condition_1 VARCHAR(255),
    clinical_trial_address VARCHAR(255),
    clinical_trial_institution VARCHAR(255),
    clinical_trial_address_1 VARCHAR(255),
    clinical_trial_main_researcher VARCHAR(255),
    clinical_trial_condition_2 VARCHAR(255)
);
select count(*) from sampleInformation   ;

