CREATE TABLE IF NOT EXISTS sampleInformation (
    drug_name VARCHAR(100) CHARACTER SET utf8 ,  -- No single quotes are needed for column types
    side_effect VARCHAR(255) CHARACTER SET utf8,  -- Side effect column definition without quotes
    side_effect_1 VARCHAR(255) CHARACTER SET utf8,
    side_effect_2 VARCHAR(255) CHARACTER SET utf8,
    side_effect_3 VARCHAR(255) CHARACTER SET utf8,
    side_effect_4 VARCHAR(255) CHARACTER SET utf8,
    interacts_with VARCHAR(100) CHARACTER SET utf8,
    interacts_with_1 VARCHAR(100) CHARACTER SET utf8,
    interacts_with_2 VARCHAR(100) CHARACTER SET utf8,
    disease_name VARCHAR(255) CHARACTER SET utf8,
    disease_category VARCHAR(100) CHARACTER SET utf8,
    drug_category VARCHAR(100) CHARACTER SET utf8,
    product_name VARCHAR(100) CHARACTER SET utf8,
    company_name VARCHAR(100) CHARACTER SET utf8,
    clinical_trial_title VARCHAR(255) CHARACTER SET utf8,
    clinical_trial_start_date DATE,  -- Use DATE type for date without single quotes
    clinical_trial_completion_date DATE,  -- Same here, no quotes for DATE values
    clinical_trial_participants INT,  -- INT type does not require quotes
    clinical_trial_status VARCHAR(50) CHARACTER SET utf8,
    clinical_trial_condition VARCHAR(255) CHARACTER SET utf8,
    clinical_trial_condition_1 VARCHAR(255) CHARACTER SET utf8,
    clinical_trial_address VARCHAR(255) CHARACTER SET utf8,
    clinical_trial_institution VARCHAR(255) CHARACTER SET utf8,
    clinical_trial_address_1 VARCHAR(255) CHARACTER SET utf8,
    clinical_trial_main_researcher VARCHAR(100) CHARACTER SET utf8,
    clinical_trial_condition_2 VARCHAR(255) CHARACTER SET utf8
);


